import styles from "./AppHeader.module.css";
// import { data } from "../../utils/data";
import {
  BurgerIcon,
  ProfileIcon,
  ListIcon,
  Logo,
} from "@ya.praktikum/react-developer-burger-ui-components";
// import { ListIcon } from "@ya.praktikum/react-developer-burger-ui-components/dist/ui/icons";
// import { Logo } from "@ya.praktikum/react-developer-burger-ui-components/dist/ui/logo";
// import { ProfileIcon } from "@ya.praktikum/react-developer-burger-ui-components/dist/ui/icons";

function AppHeader() {
  return (
    <header>
      <nav
        className={styles.AppHeader}
        style={{ color: "white", backgroundColor: "#1C1C21" }}
      >
        <ul style={{ display: "flex", listStyle: "none" }}>
          <li className="pl-5 pb-4 pt-4 pr-2">
            <BurgerIcon type="primary" />
          </li>
          <li className="pl-2 pb-4 pt-4 pr-5 mr-2">
            <a
              href="#"
              style={{ textDecoration: "none", color: "white" }}
              className="text text_type_main-default"
            >
              Конструктор
            </a>
          </li>
          <li className="pl-5 pb-4 pt-4 pr-2">
            <ListIcon type="secondary" />
          </li>
          <li className="pl-2 pb-4 pt-4 pr-5">
            <a
              href="#"
              style={{ textDecoration: "none" }}
              className="text text_type_main-default text_color_inactive"
            >
              Лента заказов
            </a>
          </li>
        </ul>
        <Logo />
        <div style={{ display: "flex" }}>
          <div className="pl-5 pb-4 pt-4 pr-2">
            <ProfileIcon type="secondary" />
          </div>
          <div className="pl-2 pb-4 pt-4 pr-">
            <a
              href="#"
              style={{ textDecoration: "none" }}
              className="text text_type_main-default text_color_inactive"
            >
              Личный кабинет
            </a>
          </div>
        </div>
      </nav>
    </header>
  );
}

export default AppHeader;
